import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import Nav from "../../components/Nav";
import axios from 'axios';
import CustomPagination from './Pagination'; // 사용자 정의 페이지네이션 컴포넌트 임포트

const MyPage = () => {
  const [projects, setProjects] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [projectsPerPage] = useState(5);
  const isLoggedIn = true; 
  const showSearch = false;

  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const response = await axios.get('/data.json'); // 데이터 파일 경로
        setProjects(response.data);
      } catch (error) {
        console.error("Error fetching the projects:", error);
      }
    };

    fetchProjects();
  }, []);

  const indexOfLastProject = currentPage * projectsPerPage;
  const indexOfFirstProject = indexOfLastProject - projectsPerPage;
  const currentProjects = projects.slice(indexOfFirstProject, indexOfLastProject);

  const handlePageChange = (event, value) => {
    setCurrentPage(value); // 페이지 변경 핸들러
  };

  return (
    <Container>
      <Nav isLoggedIn={isLoggedIn} showSearch={showSearch} />

      <List>
        <ul>
          <li><a href="#">신청 목록</a></li>
          <li><a href="#">관심 목록</a></li>
          <li><a href="#">작성 목록</a></li>
          <li><a href="#">임시 저장</a></li>
          <li><a href="#">마감 목록</a></li>
          <li><a href="#">개인 정보</a></li>
        </ul>
      </List>

      <ProjectList>
        {currentProjects.map((project) => (
          <ProjectItem key={project.pk}>
            <ProjectHeader>
              <span>{project.creatorID}</span>
              <span>❤️ {project.likesCount}</span>
            </ProjectHeader>
            <p>{project.title}</p>
            <Tags>
              {project.tags.map((tag, index) => (
                <span key={index}>{tag}</span>
              ))}
            </Tags>
            <Button>모집 진행중</Button>
          </ProjectItem>
        ))}
      </ProjectList>

      {/* 사용자 정의 페이지네이션 컴포넌트 사용 */}
      <CustomPagination 
        currentPage={currentPage} 
        totalProjects={projects.length} 
        projectsPerPage={projectsPerPage} 
        onPageChange={handlePageChange} 
      />
    </Container>
  );
};

export default MyPage;

const Container = styled.div`
  padding: 20px;
`;

const List = styled.div`
  margin-bottom: 20px;

  ul {
    list-style: none;
    display: flex;
    gap: 20px;
  }

  a {
    text-decoration: none;
    color: #007bff;
  }
`;

const ProjectList = styled.div`
  margin-bottom: 20px;
`;

const ProjectItem = styled.div`
  border: 1px solid #e0e0e0;
  border-radius: 8px;
  padding: 15px;
  margin-bottom: 15px;
`;

const ProjectHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Tags = styled.div`
  margin: 10px 0;

  span {
    background-color: #e0e0e0;
    border-radius: 4px;
    padding: 5px;
    margin-right: 5px;
  }
`;

const Button = styled.button`
  background-color: #007bff;
  color: white;
  border: none;
  padding: 10px 15px;
  border-radius: 5px;
  cursor: pointer;
`;
